import { Flight } from "./flight"
import { Passenger } from "./passenger";

export class Book {
    bookId:number|undefined;
    flightId: number | undefined= Flight.flightId;
    origin: string | undefined
    destination: string | undefined
    flightdate: string | undefined
    bookingDate !: Date;
    fare!:{
        fare: string;
    }
    status !: string;
    passenger !: Passenger;
    available !:string;
}
